def raw_call():

    contract_abi = [
        {
            "constant": True,
            "inputs": [
                {
                    "name": "_owner",
                    "type": "address"
                }
            ],
            "name": "balanceOf",
            "outputs": [
                {
                    "name": "balance",
                    "type": "uint256"
                }
            ],
            "payable": False,
            "stateMutability": "view",
            "type": "function"
        }
    ]

    contract = w3.eth.contract(address=CHAI, abi=contract_abi)

    def get_balance_at_block(account, block_number):
        try:
            balance = contract.functions.balanceOf(account).call(block_identifier=None)
            print(f'Balance at block {block_number}: {balance}')
        except Exception as e:
            print(f'Error making call: {e}')

    # Your account address
    account = Web3.to_checksum_address('0x58ea9f698f60c20d15e40ae3d009a41d8c6ebd4f')
    # The block number at which to query the balance
    block_number = 64279918  # Replace with the desired block number

    get_balance_at_block(account, block_number)


